paths:
  tmp0:
    post:
      description: Creates a watchlist identifier.
      parameters:
      - description: The Watchlist Type can be domain, email, or ip.
        example: domain
        in: query
        name: Watchlist Type
        required: true
        schema: {type: string}
      - description: The identifier to create.
        example: example.org
        in: query
        name: Identifier
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: SpyCloud Create Watchlist Identifier
  tmp1:
    post:
      description: Deletes a watchlist identifier.
      parameters:
      - description: The identifier to delete. The input can be a domain, email, or
          IP Address
        example: 139.130.4.5
        in: query
        name: Identifier
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: SpyCloud Delete Watchlist Identifier
  tmp10:
    post:
      description: Query/List breaches in the catalog.
      parameters:
      - description: Token used for iterating through multiple pages of results. By
          default if >1000 results returned, cursor is returned.
        example: ''
        in: query
        name: Cursor
        required: false
        schema: {type: string}
      - description: Query value to search the breach catalog for.
        example: Name of malicious actor, domain name, etc.
        in: query
        name: Query
        required: false
        schema: {type: string}
      - description: Allows you defined the starting point for a date range query
          on the spycloud_publish_date field.
        example: YYYY-MM-DD - 2018-02-15
        in: query
        name: Since
        required: false
        schema: {type: string}
      - description: Allows you defined the endpoint for a date range query on the
          spycloud_publish_date field.
        example: YYYY-MM-DD - 2018-02-15
        in: query
        name: Until
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: SpyCloud Query Breach Catalog
  tmp11:
    post:
      description: Allows one to query information about specific watchlist identifiers.
      parameters:
      - description: 'Watchlist to search for: email, domain, or ip'
        example: email
        in: query
        name: Watchlist
        required: false
        schema: {type: string}
      - description: 'Filter by verified status: yes or no. Default is both.'
        example: 'yes'
        in: query
        name: Verified
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp11'}
          description: Successful request
      summary: SpyCloud Query Watchlist Identifiers
  tmp2:
    post:
      description: Search for a specific breach by ID.
      parameters:
      - description: Numerical ID of the Breach
        example: '1'
        in: query
        name: ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: SpyCloud Get Breach Catalog by ID
  tmp3:
    post:
      description: Retrieve breach data about a specified domain.
      parameters:
