          all types. Enter 'corporate' for corporate records and 'infected' for infected
          user records.
        example: corporate
        in: query
        name: Type
        required: false
        schema: {type: string}
      - description: Token used for iterating through multiple pages of results. By
          default if >1000 results returned, cursor is returned.
        example: ''
        in: query
        name: Cursor
        required: false
        schema: {type: string}
      - description: Allows you defined the starting point for a date range query
          on the spycloud_publish_date field.
        example: YYYY-MM-DD - 2018-02-15
        in: query
        name: Since
        required: false
        schema: {type: string}
      - description: Allows you defined the endpoint for a date range query on the
          spycloud_publish_date field.
        example: YYYY-MM-DD - 2018-02-15
        in: query
        name: Until
        required: false
        schema: {type: string}
      - description: Allows you to filter based on numeric severity code.
        example: '20'
        in: body
        name: Severity
        required: false
        schema: {type: string}
      - description: Allows you to filter based on a particular breach source.
